def master_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine=machine,
                                   parent_field='{}_is_master'.format(field_prefix),
                                   child_fields=[
                                       'is_master',
                                       'logical_session_timeout_minutes',
                                       'max_bson_object_size',
                                       'max_message_size_bytes',
                                       'max_wire_version',
                                       'max_write_batch_size',
                                       'min_wire_version',
                                       'read_only',
                                   ],
                                   description=''' Result of issuing the isMaster command 
                                   see https://docs.mongodb.com/manual/reference/command/isMaster''')
    return res


def build_info(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_BUIND_INFO_MAX_WIRE_VERSION'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_build_info_max_wire_version'.format(field_prefix),
                               t='int'),
            'description': 'DEPRECATED'
        })
    ]
    res += enumerated_field(machine,
                            field='{}_build_info_version'.format(field_prefix),
                            enum_list=mongodb_versions,
                            version=True,)

    res += enumerated_field(machine,
                            field='{}_build_info_git_version'.format(field_prefix),
                            enum_list=mongodb_git_versions,
                            version=True,)

    res += enumerated_field(machine,
                            field='{}_build_info_build_environment_target_os'.format(field_prefix),
                            enum_list=operating_systems)
    return res


def meta_features(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_supported'.format(field_prefix),
                               t='int'),
            'description': 'is {} supported?'.format(field_prefix)
        })
    ]
    return res


def extract(machine, args):
    res = []
    protocol = 'mongodb'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)
        res += build_info(machine, field_prefix)
        res += master_features(machine, field_prefix)
        res += meta_features(machine, field_prefix)

    return res


